import React, { Component } from "react";
import Colorback from "./Colorback";
import { Link } from "react-router-dom";

export default class Projects extends Component {
  render() {
    return (
      <div className="App">
        <h1>hello projects</h1>

        <Link to="/projects/strange">So Strange Loops</Link>
        <Link to="/projects/Shoot">"Can You Shoot Me an Alphabet?"</Link>
        <Link to="/projects/sketchup">Sketchup Explorations</Link>
        <Link to="/projects/grimeton">Grimeton Identity</Link>
        <Link to="/projects/falcon">Falconers Code</Link>

        <Colorback />
      </div>
    );
  }
}
